var tipuesearch = {"pages": [{'title': 'About', 'text': '國立虎尾科技大學機械設計工程系 \n National Formosa University \n Department of Mechanical Design Engineering \n 41223133 陳士弘 火箭設計與學習網站 \n Rocket designing and learning site \n \n 介紹: \n 這裡是我自己利用國立虎尾科技大學機械設計工程系的嚴家銘老師製作出來的程式以及網站使用github的fork轉移過來的網站，我有次突然想到，如果我自己利用嚴老師所設計出來的網站來自己打造一個火箭學習歷程的網站來編輯，那我自己就可以趁機利用自己所學來打造出一個屬於我自己的火箭學習網站了。 \n 至於為什麼要使用這個網站呢? \n 因為我今年2024年準備要參加台灣盃的火箭競賽，所以我在明年2025年的7、8月之前會密集的學習有關火箭的一切知識。再加上上面我所提到的動機，造就了這個網站的誕生。 \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 編輯時間:2024/12/15\xa0 \xa0AM 12:19 \n \n', 'tags': '', 'url': 'About.html'}, {'title': 'Open Rocket', 'text': '這個影片是我第一次使用Open Rocket軟體的影片: \n', 'tags': '', 'url': 'Open Rocket.html'}]};